import React, { Component } from "react";
import FaleMais from "./FaleMais";

class Planos extends Component {
  state = {
    planos: [
      {
        title: 'FaleMais 30',
        category: 'form 30'
      },
      {
        title: 'FaleMais 60',
        category: 'form 60'
      },
      {
        title: 'FaleMais 120',
        category: 'form 120'
      },
    ]
  }

  renderList = () =>
    this.state.planos.map((planos, index) => {
      //console.log(planos);
      return <FaleMais key={index} planos={planos} />;
    });
  render() {
    return (
      <div className="Planos">{this.state.planos && this.renderList()}</div>
    );
  }
}

export default Planos;
